content="La velocidad en el universo\n\nPiensa esto las galaxias y los clusters se mueven a velocidad muy lenta en comparacion a nuestro punto de vista. Al igual que al punto de vista del sol todos se muevan mas rapido. Es porque a nivel molecular nosotros pensamos que los electrones por ejemplo giran o se mueven al rededor del nucleo mas rapido que el mismo nucleo. Es porque en realidad al punto de vista del nucleo tiene que acelerar mas rapido que el electron para superar esta energia 3rd newton law.  Esto se asemeja al tiempo en el que es mas rapido/lento dependiendo de la masa del objeto. Entre mas masivo el elento menos puede acelerar a niveles catastroficos que terminen con el universo mismo. Ej, una galaxia que gira demasiado rapido termina destruyendose y convirtiendose un agujero negro gigante mismo. Es por eso que a nivel astronomico un agujero negro no acelera casi nada dado a su densidad que se puede interpretar en masa gigantesca. Pienselo. A nivel micocroscopico la masa es tan pequena que pueden girar/acelerar en niveles extraodinarios. \nEl tiempo es relativo, a su nivel de masa.\nTime is always now,, for us..."
